  test('generate RSA-PSS test case', () async {
    await runner.generate(
      generateKeyParams: {
        'hash': hashToJson(Hash.sha512),
        'modulusLength': 4096,
        'publicExponent': '65537',
      },
      importKeyParams: {'hash': hashToJson(Hash.sha512)},
      signVerifyParams: {'saltLength': 67},
      maxPlaintext: 80,
    );
  });

  runner.runTests();
}

